import {loadModel} from '@tensorflow/tfjs'
import React from 'react'

let model = null
model = loadModel('https://drive.google.com/open?id=1XJk68dpwsFKnOU5rCUkr9AYKxjZFlzGK')

const Main = () => {

	if (model == null) 
		console.log('model loaded')
	return null
}

export default Main;
